import React from "react";
import {
  AboutContainer,
  AboutBg,
  AboutContent,
  AboutH1,
  AboutP,
  AboutFrost,
} from "./AboutElms";

const About = () => {
  return (
    <AboutContainer id="about">
      <AboutBg>
        <AboutContent>
          <AboutH1>About Me</AboutH1>
          <AboutP>My name is slim shady.</AboutP>
        </AboutContent>
        <AboutFrost />
      </AboutBg>
    </AboutContainer>
  );
};

export default About;
